import React from 'react'
import Navbar from './Navbar'
import {Link} from 'react-router-dom'
import { useState , useEffect } from 'react'
import axios from "axios"

export const EditProfile = () => {

    const [userInfo, setuserInfo] = useState({})

    const currId = "61275e11f0201774782ba0cd"

    useEffect(() => {
        
        const fetchInfo = async () => {
            try {
                const uinfo = await axios.get(`/user/${currId}`)
                setuserInfo(uinfo.data)
            } catch (err) {
                console.log("Error")
            }
        }
        fetchInfo()
    }, [])

    use


    return (
        <div>
            <Navbar/>
        <div className="container">
            <div className="box">
                Update!<br/><br/><br/>

                Name <input type="text" value={userInfo.name} onChange = {(e)=>e.target.value} /><br/>
                Uname <input type="text" value={userInfo.userName}  onChange = {(e)=>e.target.value}  /><br/>
                Phone <input type="text" value={userInfo.contact} onChange = {(e)=>e.target.value} /><br/>
                Umar <input type="number" value={userInfo.age} onChange = {(e)=>e.target.value} /><br/>
                
                <br/><br/>

                <button className="signupbutton"> Update! </button> <br/><br/>
            </div>
        </div>
        </div>
    )
}

export default EditProfile
